  \"a-comprehensive-plan-to-resolve-resource-problems-at-necedah-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In October of 1981, the U. S. Fish and
  Wildlife Service sent out a questionnaire to all field stations. The stations were
  requested to identify all field station threats and conflicts. Nine resource problems
  were identified at Necedah National Wildlife Refuge. This comprehensive plan addresses
  current and planned actions to correct these problems by the staff of the Necedah
  Refuge. The 1983 Jobs Bill, Service Construction Funds, and the Accelerated Refuge
  Maintenance Management (ARRM) Program have made some progress possible in addressing
  these identified problems. A pending reprogramming request before Congress is intended
  to further help the refuge staff address these problems. This plan was assembled
  in response to a request by the Chairman of the House Appropriations Committee in
  January of 1984. The corrective actions identified by Service managers reflect our
  best estimate of solutions at known levels of funding and manpower. The management
  summary which follows the section on resource problems is intended to summarize
  current and planned actions utilizing discretionary funds to address these problems.\",\n\t\"license_title\":
